function Menu() {
  const menus = [
    {
      id: '1',
      title: 'My first menu',
      content: 'Pizza',
    },
    {
      id: '2',
      title: 'My Second menu',
      content: 'Ham',
    },
  ];
  return <div>Menu</div>;
}

export default Menu;
